			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# 如果工程名称和Framework的Target名称不一样的话，要自定义FMKNAME\n# 例如: FMK_NAME = \"MyFramework\"\nFMK_NAME=${PROJECT_NAME}\n\n# 最后合成framework的文件目录\nINSTALL_DIR=${SRCROOT}/HH_FMW_PRODUCTS/${FMK_NAME}.framework\n\n# 编译完成后生成的真机环境和模拟器环境的framework文件目录\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\n# -configuration ${CONFIGURATION}\n\n# 编译真机环境和模拟器环境\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build\n\nxcodebuild -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build\n#xcodebuild -target \"HHNetworking\" -configuration \"Release\" -project \"HHNetworking.xcodeproj\" -sdk iphonesimulator ARCHS=\"i386 x86_64\" VALID_ARCHS=\"i386 x86_64\" clean build\n\n#xcodebuild -target \"HHNetworking\" -configuration \"Release\" -project \"HHNetworking.xcodeproj\" -sdk iphoneos ARCHS=\"armv7 armv7s arm64\" VALID_ARCHS=\"armv7 armv7s arm64\" clean build\n# 将旧的framework删掉\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\n\n# 创建一个新的framework文件目录\nmkdir -p \"${INSTALL_DIR}\"\n\n# 将真机环境下编译完成的framework copy到最后合成的目录下\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n# 将真机环境下的framework和模拟器环境下的framework合并 (i386 + armv6/armv7) 生成最终的文件\n\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\nrm -r \"${WRK_DIR}\"\n#打开合成的framework\n\n#open \"${INSTALL_DIR}\"\n\n\n";
